function confirmarEliminarPeticion(posicionPeticionSel) {
Swal.fire({
title: "¿Estás segur@ de eliminar la publicación?",
        text: "Esto ya no se podrá revertir!",
        icon: "warning",
        showCancelButton: true,
        confirmButtonColor: "#3085d6",
        cancelButtonColor: "#d33",
        confirmButtonText: "Si, eliminar!"
        }).then((result) => {
if (result.isConfirmed) {
eliminarPeticion(posicionPeticionSel);
        }
});
}



function eliminarPeticion(posicionPeticionSel) {
let peticionSeleccionada = localStorage.getItem(`peticion${posicionPeticionSel}`);
        let peticionObjeto = JSON.parse(peticionSeleccionada);
        let url = "http://localhost:8080/QualityMultiservices_v2/api/administrarPeticion/eliminarPeticion";
        let params = {
        idPeticion: peticionObjeto.idPeticion,
                token: localStorage.getItem("token").toString()
        };
        const queryString = new URLSearchParams(params).toString();
        const requestOptions = {
        method: 'POST',
                headers: {'Content-Type': 'application/x-www-form-urlencoded'},
                body: queryString // Enviar la cadena de consulta como el cuerpo de la solicitud
        };
        fetch(url, requestOptions).then(
        function (jsonText) {
        return jsonText.json();
        }
).then(
        function (data) {

        if (data.Mensaje === "Token no validado") {

        Swal.fire({
        icon: "error",
                title: "Usuario no válidado...",
                text: "Inicia sesión"
        });
        } else if (data.idTicket === "Publicación tipo petición eliminada con éxito") {
        Swal.fire({
        icon: "error",
                title: "Oops...",
                text: "Ah ocurrido un problema!"
        });
        } else {

        Swal.fire({
        icon: "success",
                title: "Publicación eliminada!",
                showConfirmButton: false,
                timer: 1500
        });
                mostrarPublicacionesPeticiones();
        }
        }
);
}

